DELIMITER //
CREATE PROCEDURE getListColleague
(IN array VARCHAR(1000))
BEGIN
select emp_id from Employee
where cube_id in (select DISTINCT(cube_id) from employee where FIND_IN_SET(emp_id, array));
END //
DELIMITER 


DELIMITER //
CREATE PROCEDURE getBatchList()
BEGIN
SELECT survey_batch_id,survey_batch.freq_id,frequency_master.freq_name,start_date,end_date FROM survey_batch join frequency_master
on survey_batch.freq_id=frequency_master.freq_id;
END //
DELIMITER 



DELIMITER //
CREATE PROCEDURE getQuestionList()
BEGIN
select * from (SELECT question.que_id,question.question,question.que_type,question.survey_batch_id,question.startdate,question.enddate,count(distinct(me_response.emp_id))/(select count(emp_id) from employee) as resp  FROM question,me_response
where question.que_id=me_response.que_id group by question.que_id
Union
SELECT question.que_id,question.question,question.que_type,question.survey_batch_id,question.startdate,question.enddate,count(distinct(we_response.emp_id))/(select count(emp_id) from employee) as resp  FROM question,we_response
where question.que_id=we_response.que_id group by question.que_id) as t
order by t.que_id;
END //
DELIMITER 


DELIMITER //
CREATE PROCEDURE getQuestionListForBatch(
in batchid int)
BEGIN
select * from (SELECT question.que_id,question.question,question.que_type,question.survey_batch_id,question.startdate,question.enddate,count(distinct(me_response.emp_id))/(select count(emp_id) from employee) as resp  FROM question,me_response
where question.que_id=me_response.que_id and question.survey_batch_id=batchid group by question.que_id
Union
SELECT question.que_id,question.question,question.que_type,question.survey_batch_id,question.startdate,question.enddate,count(distinct(we_response.emp_id))/(select count(emp_id) from employee) as resp  FROM question,we_response
where question.que_id=we_response.que_id and question.survey_batch_id=batchid group by question.que_id) as t
order by t.que_id;
END //
DELIMITER 


DELIMITER //
CREATE PROCEDURE getQuestionListForQuestion(
in queid int)
BEGIN
select * from (SELECT question.que_id,question.question,question.que_type,question.survey_batch_id,question.startdate,question.enddate,count(distinct(me_response.emp_id))/(select count(emp_id) from employee) as resp  FROM question,me_response
where question.que_id=me_response.que_id and question.que_id=queid group by question.que_id
Union
SELECT question.que_id,question.question,question.que_type,question.survey_batch_id,question.startdate,question.enddate,count(distinct(we_response.emp_id))/(select count(emp_id) from employee) as resp  FROM question,we_response
where question.que_id=we_response.que_id and question.que_id=queid group by question.que_id) as t
order by t.que_id;
END //
DELIMITER 




DELIMITER //
CREATE PROCEDURE updateBatch(
in batchid INT,
in freq INT,
in sdate ,
in edate INT
)
BEGIN
update survey_batch 
set freq_id=freq,start_date=sdate,end_date=edate
where survey_batch_id=batchid;
END //
DELIMITER 



DELIMITER //
CREATE PROCEDURE updateQuestionDate(
in queid INT,
in sdate Date,
in edate Date
)
BEGIN
update question 
set startdate=sdate,enddate=edate
where que_id=queid;
END //
DELIMITER 


DELIMITER //
CREATE PROCEDURE getFrequencyList(
)
BEGIN
SELECT * FROM frequency_master;
END //
DELIMITER 


DELIMITER //
CREATE PROCEDURE getResponseData(
in queid INT
)
BEGIN
select que_id,count(Distinct(emp_id)) responses,date(response_time) as date from me_response
where que_id=queid
group by date(response_time) 
union
select que_id,count(Distinct(emp_id)) as responses ,date(response_time) as date from we_response
where que_id=queid
group by date(response_time); 
END //
DELIMITER




